function getSymbol(length, char) {
  var count = 0
  var str = ''
  while (count < length) {
    str += char // '*'
    count++
  }
  return str

  // Another option:
  // return char.repeat(length)
}

function getTriangle(height, char) {
  if (height === 1) return char
  var count = 1
  var triangle = ''
  while (count < height) {
    triangle += getSymbol(count, char) + '
'
    count++
  }
  while (count > 0) {
    triangle += getSymbol(count, char) + '
'
    count--
  }
  return triangle
}

/*
 ***
 *
 *****
 *
 */
function getMusicEqualizer(rowsCount, char) {
  var count = 0
  var equalizer = ''
  while (count < rowsCount) {
    var randomNum = getRandomInteger(1, 10)
    equalizer += getSymbol(randomNum, char) + '
'
    count++
  }
  return equalizer
}

function patternBlock(rows, cols, char) {
  var count = 0
  var str = ''
  while (count < rows) {
    str += getSymbol(cols, char) + '
'
    count++
  }
  return str
}

function getPatternOutline(rows, cols, char) {
  var count = 0
  var str = ''
  while (count < rows) {
    if (count === 0 || count === rows - 1) {
      str += getSymbol(cols, char) + '\r'
    } else {
      str += _getEmptyLine(cols, char) + '\r'
    }
    count++
  }
  return str
}

function _getEmptyLine(length, char) {
  var str = char
  var count = length - 2
  while (count > 0) {
    str += ' '
    count--
  }
  str += char
  return str
}

function getRandomInteger(min, max) {
  min = Math.ceil(min)
  max = Math.floor(max)
  return Math.floor(Math.random() * (max - min) + min) //The maximum is exclusive and the minimum is inclusive
}
