function findGCD(num1, num2) {
  var divider
  if (num1 < num2) {
    divider = num1
  } else {
    divider = num2
  }

  // short-if
  var divider = num1 < num2 ? num1 : num2

  while (divider) {
    if (num1 % divider === 0 && num2 % divider === 0) return divider
    divider--
  }
}

