function removeDuplicates(nums) {
  var numCounters = [0, 0, 0, 0, 0, 0]
  var res = []
  for (var i = 0; i < nums.length; i++) {
    if (numCounters[nums[i]] === 0) {
      numCounters[nums[i]]++
      res.push(nums[i])
    }
  }
  return res
}

