function multBy(nums, multiplier) {
    for (var i = 0; i < nums.length; i++) {
        nums[i] *= multiplier;
    }
    return nums
}

//Part b
function multBy(nums, multiplier, isImmutable) {
    var newNums = isImmutable ? nums.slice() : nums
    for (var i = 0; i < newNums.length; i++) {
        newNums[i] *= multiplier
    }
    return newNums
}

